import React from 'react'
import './Child2.css'

import P5Wrapper from 'react-p5-wrapper';
import plastic from './sketches/plastic';
import plasticImage from './bottle1.png'

class Child2 extends React.Component {
    constructor(props) {
        super(props);
        this.state = { };
    }

    render() {
        return (
          <div>
            <P5Wrapper sketch={plastic} plasticData = {this.props} ></P5Wrapper>
            <img src={plasticImage} alt="plasticImage" />
          </div>


        );
    }

    componentDidMount() {
        console.log("Child2 Mounted");
    }

    componentDidUpdate(prevProps, prevState, snapshot) {
        console.log("Child2 Updated");
    }
}

export default Child2
